import wave
import math
import numpy as np
import pyaudio
import pylab

# ======= (1) TRANSMITTED SIGNALS ======= 

# Signal source directions
az = np.array([35,39,127]); # Azimuths
el = np.zeros(az.shape); # Simple example: assume elevations zero
M = np.size(az); # Number of sources
print(az)
# Transmitted signals
L = 200; # Number of data snapshots recorded by receiver (Nbre d'echantillons)
m = np.random.randn(M,L); # Example: normally distributed random signals

# ========= (2) RECEIVED SIGNAL ========= 

# Wavenumber vectors (in units of wavelength/2)
k = math.pi*np.array([np.cos(np.radians(az))*np.cos(np.radians(el)), np.sin(np.radians(az))*np.cos(np.radians(el)), np.sin(np.radians(el))]);

# Array geometry [rx,ry,rz]
N = 10; # Number of antennas
rx=np.linspace(-(N-1)/2.0,(N-1)/2.0,N).reshape(N,1);
ry=np.zeros((N,1),float);
rz=np.zeros((N,1),float);

r = np.concatenate((rx,ry,rz),axis=1); # Assume uniform linear array

# Matrix of array response vectors
A = np.exp(-1j*np.dot(r,k));

# Additive noise
sigma2 = 0.01; # Noise variance
n = math.sqrt(sigma2)*(np.random.randn(N,L) + 1j*np.random.randn(N,L))/math.sqrt(2);


# Received signal
x = np.dot(A,m) + n;
